import React from 'react';

const Homes1 = () => {
  return (
    <div>
      <div class="container">
        <div class="row">
          <div class="col-3">1</div>
          <div class="col-3">2</div>
          <div class="col-3">3</div>
          <div class="col-3">4</div>
        </div>
      </div>
    </div>
  );
};

export default Homes1;
